description:
Filmens rytm skulle frammana kanslan av en doende manniskas sista
flamtande andetag, Once upon a time in the west var fran borjan till
slut en dodsdans. Alla filmens rollfigurer, utom Claudia (Cardinale) ar
medvetna om att de inte kommer att na slutet levande...

Regi: Sergio Leone. 
Medv: Henry Fonda, Claudia Cardinale, Charles Bronson och Jason
Robards.
